const [chats, setChats] = useState([])

const Dashboard = ({ books }) => {
    return (
        <div className="p-6 pt-20 text-center grow flex flex-col items-center gap-8">
            <div className="bg-gray-50 hover:bg-indigo-50 w-full h-20 rounded-xl flex justify-center items-center">
                <h1 className="text-lg text-gray-400">Create New Chat</h1>
            </div>
            <div className="bg-gray-50 hover:bg-indigo-50 w-full h-4/6 rounded-xl p-4 pb-6">
                <h2 className="text-left text-2xl mb-4 font-medium">Pick up where you left off</h2>
                <ul className="overflow-x-scroll gap-8 w-full h-full">
                {chats.map((chatId, index) => (
                    <SidebarListItem
                    key={index}
                    icon={BookIcon}
                    label={!isCollapsed && `Chat ${index + 1}`}
                    href="#"
                    isSelected={selectedItem === `Chat ${index + 1}`}
                    onClick={() => {
                        setSelectedItem(`Chat ${index + 1}`)
                        onSelectChat(chatId)
                    }}
                    />
                ))}
                </ul>
            </div>
            <div className="bg-gray-50 hover:bg-indigo-50 w-full h-4/6 rounded-xl p-4 pb-6">
                <h2 className="text-left text-2xl mb-4 font-medium">Curated for You</h2>
                <ul className="overflow-x-scroll gap-8 w-full h-full">
                {books.map((book) => (
                    <div className="flex">
                        <div key={book.id} className={`cursor-pointer bg-indigo-400 min-w-32 h-full flex items-center justify-center drop-shadow-xl shadow-inner border-b-2 border-gray-200 ${book.available ? '' : 'opacity-30'}`}>
                            <h4 className="text-lg bg-yellow-50 font-bold w-full h-24 text-sm flex items-center justify-center">{book.title}<br />—<br />{book.author}</h4>
                        </div>
                        <div className="text-left ml-4">
                            <h2 className="font-medium">{book.title}</h2>
                            <h3 className="">{book.author}</h3>
                            <p className="text-sm">{book.description}</p>
                        </div>
                    </div>
                ))}
                </ul>
            </div>
            <div className="bg-gray-50 hover:bg-indigo-50 w-full h-4/6 rounded-xl p-4 pb-6">
                <h2 className="text-left text-2xl mb-4 font-medium">Explore our Library</h2>
                <ul className="overflow-x-scroll gap-8 w-full h-full">
                {books.map((book) => (
                    <div className="flex">
                        <div key={book.id} className={`cursor-pointer bg-indigo-400 min-w-32 h-full flex items-center justify-center drop-shadow-xl shadow-inner border-b-2 border-gray-200 ${book.available ? '' : 'opacity-30'}`}>
                            <h4 className="text-lg bg-yellow-50 font-bold w-full h-24 text-sm flex items-center justify-center">{book.title}<br />—<br />{book.author}</h4>
                        </div>
                        <div className="text-left ml-4">
                            <h2 className="font-medium">{book.title}</h2>
                            <h3 className="">{book.author}</h3>
                            <p className="text-sm">{book.description}</p>
                        </div>
                    </div>
                ))}
                </ul>
            </div>
        </div>
    );
};

export default Dashboard;
